import React, { useState, useEffect } from 'react';
import './CustomSlider.css'; // Import the custom CSS for the slider
import {
  Card,
  CardContainer,
  CardText,
  CardTitle,
  CardSubtitle,
  CardButton
} from './UniversityCard.styles';

const UniversityCard = ({ name, city, branch, percentile, onApply }) => {
  const [showFullName, setShowFullName] = useState(false);
  const [firstPart, rest] = name.split(',', 2);

  return (
    <Card>
      <CardText>
        <CardTitle>
          {firstPart}
          {showFullName && `,${rest}`}
          {!showFullName && rest && (
            <button
              onClick={() => setShowFullName(true)}
              style={{ color: 'blue', cursor: 'pointer' }}
            >
              .Read More
            </button>
          )}
        </CardTitle>
        <CardSubtitle>City: {city}</CardSubtitle>
        <CardSubtitle>Branch: {branch}</CardSubtitle>
        <CardSubtitle>Percentile: {percentile}</CardSubtitle>
        {/* <CardButton onClick={onApply}>Apply Now</CardButton> */}
      </CardText>
    </Card>
  );
};

const UniversityCardList = ({ universities = [] }) => {
  const [percentileRange, setPercentileRange] = useState([0, 100]);

  useEffect(() => {
    if (universities.length > 0) {
      const percentiles = universities.map((college) => Math.floor(college.percentile));
      const minPercentile = Math.min(...percentiles);
      const maxPercentile = Math.max(...percentiles);
      setPercentileRange([minPercentile, maxPercentile]);
    }
  }, [universities]);

  const handleMinChange = (event) => {
    const minValue = Math.min(Number(event.target.value), percentileRange[1]);
    setPercentileRange([minValue, percentileRange[1]]);
  };

  const handleMaxChange = (event) => {
    const maxValue = Math.max(Number(event.target.value), percentileRange[0]);
    setPercentileRange([percentileRange[0], maxValue]);
  };

  return (
    <div className="wrapper">
      <header>
        <h2>Percentile Range</h2>
        <p>Select the percentile range</p>
      </header>
      <div className="price-input">
        <div className="field">
          <input
            type="number"
            value={percentileRange[0]}
            onChange={handleMinChange}
            min="0"
            max="100"
          />
          <div className="separator">to</div>
          <input
            type="number"
            value={percentileRange[1]}
            onChange={handleMaxChange}
            min="0"
            max="100"
          />
        </div>
      </div>
      <div className="slider">
        <div
          className="progress"
          style={{
            left: `${((percentileRange[0] - 0) / (100 - 0)) * 100}%`,
            width: `${((percentileRange[1] - percentileRange[0]) / (100 - 0)) * 100}%`
          }}
        ></div>
      </div>
      <div className="range-input">
        <input
          type="range"
          min="0"
          max="100"
          value={percentileRange[0]}
          onChange={handleMinChange}
        />
        <input
          type="range"
          min="0"
          max="100"
          value={percentileRange[1]}
          onChange={handleMaxChange}
        />
      </div>
      <div className="range-values">
        <span>{percentileRange[0]}</span>
        <span>{percentileRange[1]}</span>
      </div>
      <CardContainer>
        {Array.isArray(universities) && universities.length > 0 ? (
          universities
            .filter((college) => {
              const roundedPercentile = Math.floor(college.percentile);
              return (
                roundedPercentile >= percentileRange[0] &&
                roundedPercentile <= percentileRange[1]
              );
            })
            .map((college) => (
              <UniversityCard
                key={college['_id']}
                name={college['College Name']}
                percentile={Math.floor(college['percentile'])}
                branch={college['Branch Name']}
                city={college['District']}
                onApply={() => {
                  const url = college['Website URL'];
                  const formattedURL =
                    url.startsWith('http://') || url.startsWith('https://')
                      ? url
                      : `http://${url}`;
                  window.open(formattedURL, '_blank');
                }}
              />
            ))
        ) : (
          <p>No colleges found</p>
        )}
      </CardContainer>
    </div>
  );
};

export default UniversityCardList;
